import data from "./product";
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import HomeScreen from "./screens/HomeScreen";

function App() {
  return (
    <BrowserRouter>
      <div>
      <header>
       <a href = "/">Online Store App</a>
      </header>
      <main>
        <Routes>
          <Route path = "/" element = {<HomeScreen />} />
        </Routes>
      </main>
    </div>
    </BrowserRouter>
  );
}

export default App;
